using ObjectiveC;using System;using SwiftSharp.Attributes;using Foundation;namespace UIKit{	//https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UITextInputTraits_Protocol/index.html#//apple_ref/occ/intf/UITextInputTraits	/// <summary>	/// The UITextInputTraits protocol defines features that are associated with keyboard input. All objects that support keyboard input must adopt this protocol in order to interact properly with the text input management system. The UITextField and UITextView classes already support this protocol.	/// </summary>	[iOSVersion(2)]	public interface UITextInputTraits	{		/// <summary>		/// The auto-capitalization style for the text object.		/// </summary>		[iOSVersion(2)]		[Export("autocapitalizationType")]		[Optional]		UITextAutocapitalizationType AutocapitalizationType;				/// <summary>		/// The auto-correction style for the text object.		/// </summary>		[iOSVersion(2)]		[Export("autocorrectionType")]		[Optional]		UITextAutocorrectionType AutocorrectionType;				/// <summary>		/// The spell-checking style for the text object.		/// </summary>		[iOSVersion(5)]		[Export("spellCheckingType")]		[Optional]		UITextSpellCheckingType SpellCheckingType;				/// <summary>		/// A Boolean value indicating whether the return key is automatically enabled when text is entered by the user.		/// </summary>		[iOSVersion(2)]		[Export("enablesReturnKeyAutomatically")]		[Optional]		bool EnablesReturnKeyAutomatically;				/// <summary>		/// The appearance style of the keyboard that is associated with the text object		/// </summary>		[iOSVersion(2)]		[Export("keyboardAppearance")]		[Optional]		UIKeyboardAppearance KeyboardAppearance;				/// <summary>		/// The keyboard style associated with the text object.		/// </summary>		[iOSVersion(2)]		[Export("keyboardType")]		[Optional]		UIKeyboardType KeyboardType;				/// <summary>		/// The contents of the “return” key.		/// </summary>		[iOSVersion(2)]		[Export("returnKeyType")]		[Optional]		UIReturnKeyType ReturnKeyType;				/// <summary>		/// Identifies whether the text object should hide the text being entered.		/// </summary>		[iOSVersion(2)]		[Export("secureTextEntry")]		[Optional]		bool SecureTextEntry;				/// <summary>		/// The auto-capitalization behavior of a text-based view.		/// </summary>		enum UITextAutocapitalizationType		{			/// <summary>			/// Do not capitalize any text automatically.			/// </summary>			[iOSVersion(2)]			None,						/// <summary>			/// Capitalize the first letter of each word automatically.			/// </summary>			[iOSVersion(2)]			Words,						/// <summary>			/// Capitalize the first letter of each sentence automatically.			/// </summary>			[iOSVersion(2)]			Sentences,						/// <summary>			/// Capitalize all characters automatically.			/// </summary>			[iOSVersion(2)]			AllCharacters,		}		/// <summary>		/// The auto-correction behavior of a text-based view.		/// </summary>		enum UITextAutocorrectionType		{			/// <summary>			/// Choose an appropriate auto-correction behavior for the current script system.			/// </summary>			[iOSVersion(2)]			Default,						/// <summary>			/// Disable auto-correction behavior.			/// </summary>			[iOSVersion(2)]			No,						/// <summary>			/// Enable auto-correction behavior.			/// </summary>			[iOSVersion(2)]			Yes,		}		/// <summary>		/// The spell-checking behavior of a text-based view.		/// </summary>		enum UITextSpellCheckingType		{			/// <summary>			/// Use the default spell-checking behavior. The default behavior is to enable spell-checking whenever auto-correction is also enabled.			/// </summary>			[iOSVersion(5)]			Default,						/// <summary>			/// Disable spell-checking behavior.			/// </summary>			[iOSVersion(5)]			No,						/// <summary>			/// Enable spell-checking behavior.			/// </summary>			[iOSVersion(5)]			Yes,		}						WHAT								WHAT				/// <summary>		/// The text string displayed in the “return” key of a keyboard.		/// </summary>		enum UIReturnKeyType		{			/// <summary>			/// Set the text of the return key to “return”.			/// </summary>			[iOSVersion(2)]			Default,						/// <summary>			/// Set the text of the return key to “Go”.			/// </summary>			[iOSVersion(2)]			Go,						/// <summary>			/// Set the text of the return key to “Google”.			/// </summary>			[iOSVersion(2)]			Google,						/// <summary>			/// Set the text of the return key to “Join”.			/// </summary>			[iOSVersion(2)]			Join,						/// <summary>			/// Set the text of the return key to “Next”.			/// </summary>			[iOSVersion(2)]			Next,						/// <summary>			/// Set the text of the return key to “Route”.			/// </summary>			[iOSVersion(2)]			Route,						/// <summary>			/// Set the text of the return key to “Search”.			/// </summary>			[iOSVersion(2)]			Search,						/// <summary>			/// Set the text of the return key to “Send”.			/// </summary>			[iOSVersion(2)]			Send,						/// <summary>			/// Set the text of the return key to “Yahoo”.			/// </summary>			[iOSVersion(2)]			Yahoo,						/// <summary>			/// Set the text of the return key to “Done”.			/// </summary>			[iOSVersion(2)]			Done,						/// <summary>			/// Set the text of the return key to “Emergency Call”.			/// </summary>			[iOSVersion(2)]			EmergencyCall,		}	}}